    public class Program
    {
        public static void Main(string[] args)
        {
            Console.WriteLine("Do you want to run Setup Database for FieldEngineer App? Click Enter to begin");
            Console.ReadLine();
            Console.Write("Please enter the mobile service MASTER key and press ENTER: ");
            var masterKey = Console.ReadLine().Trim();

            Console.WriteLine("Pinging the service to let the initializer create the tables...");
            var client = new HttpClient();
            var mobileServiceName = ConfigurationManager.AppSettings["MS_MobileServiceName"];
            var url = "https://" + mobileServiceName + ".azure-mobile.net/tables/equipmentSpecification";
            client.DefaultRequestHeaders.Add("X-ZUMO-MASTER", masterKey);
            var resp = client.GetAsync(url).Result;
            if (resp.IsSuccessStatusCode)
            {
                Console.WriteLine("Service created successfully, DB was successfully created.");
            }
            else
            {
                Console.WriteLine("Error calling the service. Please check your key or service configuration.");
                return;
            }

            AadHelper aadHelper = new AadHelper();
            string accessToken = aadHelper.GetAccessToken();
            string fieldAgentGroupId = ConfigurationManager.AppSettings["AadFieldAgentGroupObjectId"].ToString();
            string fieldManagerGroupId = ConfigurationManager.AppSettings["AadFieldManagerGroupObjectId"].ToString();
            aadHelper.UpdateUsersManager(accessToken, fieldAgentGroupId, fieldManagerGroupId);
            List<string> agentIds = aadHelper.GetUsersInGroup(accessToken, fieldAgentGroupId);

            MobileServiceContext context = new MobileServiceContext();
            PopulateJobsForAgents(context);

            AssignJobsToAgent(context, agentIds);
            UpdateJobsStatus(context, agentIds);

            Console.WriteLine("Successfully updated database. Hit Enter to Quit");
            Console.ReadLine();
        }

        public static void AssignJobsToAgent(MobileServiceContext context, List<string> agentIds)
        {
            var jobs = context.Jobs;
            int jobsCount = jobs.Count();
            int agentIndex = 0;
            int jobsIndex = 0;
            int split = jobsCount / agentIds.Count;
            foreach (Job job in jobs)
            {
                if (agentIndex >= agentIds.Count)
                {
                    break;
                }
                job.AgentId = agentIds[agentIndex];
                jobsIndex++;
                if (jobsIndex % split == 0)
                {
                    Console.WriteLine("Done assigning jobs to agentId: " + agentIds[agentIndex]);
                    agentIndex++;
                }
            }
            context.SaveChanges();
            Console.WriteLine("Assigned jobs to agents");
        }

        public static void UpdateJobsStatus(MobileServiceContext context, List<string> agentIds)
        {
            Console.WriteLine("Now, Updating Job status");
            var allJobs = context.Jobs.OrderBy(j => j.JobNumber);
            foreach (string agentId in agentIds)
            {
                var jobsForAgent = allJobs.Where(j => (j.AgentId == agentId));
                int split = jobsForAgent.Count() / 2;
                int jobsIndex = 0;
                foreach (Job job in jobsForAgent)
                {
                    if (jobsIndex < split)
                    {
                        job.Status = Constants.CompletedStatus;
                    }
                    if (jobsIndex == split)
                    {
                        job.Status = Constants.CurrentStatus;
                    }
                    if (jobsIndex > split)
                    {
                        job.Status = Constants.PendingStatus;
                    }
                    jobsIndex++;
                }
            }
            context.SaveChanges();
            Console.WriteLine("Updated jobs status");
        }

        private static void PopulateJobsForAgents(MobileServiceContext context)
        {
            Console.WriteLine("Populating the jobs");

            PopulateJobTable(context);
            context.SaveChanges();

            PopulateJobEquipmentMergeTable(context);
            context.SaveChanges();

            PopulateJobHistoryTable(context);
            context.SaveChanges();

            Console.WriteLine("Created jobs for the agents.");
        }

